window.bookSummaryJSON = "<p><b>Things are about to get serious for Harry Dresden, Chicago’s only professional wizard, in the next entry in the number-one </b><b><i>New York Times</i></b><b> best-selling Dresden Files.</b>&nbsp;</p> <p>Harry has faced terrible odds before. He has a long history of fighting enemies above his weight class. The Red Court of vampires. The fallen angels of the Order of the Blackened Denarius. The Outsiders.&nbsp;</p> <p>But this time it’s different. A being more powerful and dangerous on an order of magnitude beyond what the world has seen in a millennium is coming. And she’s bringing an army. The Last Titan has declared war on the city of Chicago and has come to subjugate humanity, obliterating any who stand in her way.&nbsp;</p> <p>Harry’s mission is simple but impossible: Save the city by killing a Titan. And the attempt will change Harry’s life, Chicago, and the mortal world forever.</p>"; 
